desc:
Dances across the sky, assaulting enemies
using advanced ninjutsu. Cheap to produce,
very strong against Red enemies!

Even a rusty nail can't stop the love in his heart
from beating. More versatile than Fish Cat:
strong against Red/Zombies, with area attacks.

The manifestation of the Grudge of Nobunaga
from the lives of many (and one Cat) (Area Attack)
100% chance to Freeze Black enemies.

A side effect of El Nino. Dangerously curious;
sucks up anything he tries to get a peek at.
Super high-speed Area attacks with Critical.

After identifying the target, she slips into another
summer outfit made for stealth. Time to move in
for the kill! Strong against Angels/Black (Area Atk)

Recruited from EVANGELION!
Hoping to be respected by his comrades
for his piloting skills. (Area Attack)
